import React, { useState } from 'react';
import "./App.css"
import "leaflet/dist/leaflet.css"
import { MapContainer, TileLayer, useMapEvents, Marker, Popup, Polyline } from 'react-leaflet'
import L from 'leaflet';

delete L.Icon.Default.prototype._getIconUrl;

L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png')
});

function LocationMarker() {
  const map = useMapEvents({
    click(e) {
      var popup = L.popup();
      popup
        .setLatLng(e.latlng)
        .setContent("This point has coordinates: (" + e.latlng.lat + ", " + e.latlng.lng + ")")
        .openOn(map);
    }
  })
}

function FirstLine() {
  return (
    <div>
      <Polyline color='black' positions={[[40.644516458772785, -8.657076358795168], [40.64474948504924, -8.656694144010546]]} />
      <Polyline color='green' positions={[[40.644327187923224, -8.657387495040895], [40.644516458772785, -8.657076358795168]]} />
    </div>
  );
}

function App() {
  return (
    <MapContainer id="map" center={[40.644535450793, -8.657107533110436]} zoom={20} onClick={() => alert("hello")}>
      <TileLayer
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        url='http://{s}.google.com/vt/lyrs=s&x={x}&y={y}&z={z}'
        subdomains={['mt0', 'mt1', 'mt2', 'mt3']}

        maxZoom={50}
        maxNativeZoom={45}
      />
      <LocationMarker />
      <FirstLine />

      <Marker position={[40.644535450793, -8.657107533110436]}>
        <Popup>
          Maybe future car.
        </Popup>
      </Marker>
    </MapContainer>
  );
}

export default App;
